import React from 'react'
import placementImg from './Images/you_could_be_the(web_1366).png'
import placementImg2 from './Images/placed-students-mobile.jpg'

const Placements = () => {
  return (
    <div className='container'>
      <h3>Placements:</h3>
      <div className='text-lg-center overflow-hidden'>
        {/* <img src={placementImg} classNameimg="img-fluid" alt="" /> */}
        <img src={placementImg2} classNameimg="" alt="" />

      </div>
    </div>
  )
}

export default Placements
